import React, { Component } from 'react';

class input extends Component {

    constructor(){
        super();
    }

    render() {
        return (
            <div>
                <div className="form-group">
                    <label for="exampleInputEmail1">¿Qué quieres hacer?</label>
                    <input type="email" className="form-control" name="task"/>
                </div>
                <div className="form-group">
                    <label>¿Cuando?</label>
                    <input type="date" className="form-control" name="date" />
                </div>
                <div className="form-group">
                    <label>¿A que hora?</label>
                    <input type="time" className="form-control" name="time" />
                </div>
                <button type="submit" className="btn btn-primary">Crear Tarea</button>
            </div>
        );
    }
}

export default input;
